function dfs(node, currSum, target, map, data) {
  if (!node) return;
  node.setColor("cyan", "blink");

  // current prefix sum
  currSum += node.val;

  // here is the sum we're looking for
  if (currSum === target) {
    data.count++;
    node.setColor("green");
  }

  // number of times the curr_sum  k has occured already,
  // determines the number of times a path with sum k
  // has occured upto the current node
  data.count += map.get(currSum - target) ?? 0;

  // add the current sum into hashmap
  // to use it during the child nodes processing
  map.set(currSum, (map.get(currSum) ?? 0) + 1);

  // process left subtree
  dfs(node.left, currSum, target, map, data);
  // process right subtree
  dfs(node.right, currSum, target, map, data);

  // remove the current sum from the hashmap
  // in order not to use it during
  // the parallel subtree processing
  map.set(currSum, map.get(currSum) - 1);
}

