 */
var totalCost = function (costs, k, candidates) {
  const pq = new PriorityQueue({
    compare: (a, b) => a[0] - b[0] || a[1] - b[1],
  });

  for (let i = 0; i < candidates; i++) {
    pq.enqueue([costs[i], 0]);
  }
  for (
    let i = Math.max(candidates, costs.length - candidates);
    i < costs.length;
    i++
  ) {
    pq.enqueue([costs[i], 1]);
  }

  let result = 0;
  let nextHead = candidates;
  let nextTail = costs.length - 1 - candidates;

  for (let i = 0; i < k; i++) {
    const [curCost, curSectionId] = pq.dequeue();
    result += curCost;

    // Only refill pq if there are workers outside
    if (nextHead <= nextTail) {
      if (curSectionId === 0) {
        pq.enqueue([costs[nextHead++], 0]);
      } else {
        pq.enqueue([costs[nextTail--], 1]);
      }
    }
  }

  return result;
};

return totalCost;

