/**
 * @param {number} n
 * @param {number[][]} requests
 * @return {number}
 */
var maximumRequests = function (n, requests) {
  const indegree = Array.from({ length: n }, () => 0);
  let result = 0;

  const dfs = (i, count) => {
    if (i === requests.length) {
      if (indegree.every((val) => val === 0)) {
        result = Math.max(result, count);
      }
      return;
    }

    requests.setColor(i, "green");

    // Consider this request, increment and decrement for the buildings involved.
    const [src, target] = requests[i];
    indegree[src]--;
    indegree[target]++;
    // Move on to the next request and also increment the count of requests.
    dfs(i + 1, count + 1);
    // Backtrack to the previous values to move back to the original state before the second recursion.
    indegree[src]++;
    indegree[target]--;

    requests.setColor(i, "cyan");

    // Ignore this request and move on to the next request without incrementing the count.
    dfs(i + 1, count);
  };

  dfs(0, 0);

  return result;
};

return maximumRequests;

