      left++;
      continue;
    }

    const isPivotInLeft = nums[left] < nums[middle];
    const isTargetInLeft = nums[left] <= target;

    if (isPivotInLeft !== isTargetInLeft) {
      if (isPivotInLeft) {
        left = middle + 1; // pivot is in left, target is in right
      } else {
        right = middle - 1;
      }
    } else {
      // pivot and target are in the same subarray
      if (nums[middle] < target) {
        left = middle + 1;
      } else {
        right = middle - 1;
      }
    }
  }

  return false;
};

