var maxSlidingWindow = function (nums, k) {
  const result = new Array();

  const queue = new MaxQueue(k);

  for (let i = 0; i < k; i++) {
    const num = nums[i];
    while (queue.head && num >= nums[queue.head.val]) {
      queue.removeHead();
    }
    queue.setHead(i);
  }

  result.push(nums[queue.tail.val]);

  for (let i = k; i < nums.length; i++) {
    if (queue.tail && i - queue.tail.val >= k) {
      queue.removeTail();
    }

    const num = nums[i];
    while (queue.head && num >= nums[queue.head.val]) {
      queue.removeHead();
    }
    queue.setHead(i);

    result.push(nums[queue.tail?.val]);
  }

  return result;
};

class MaxQueue {
  constructor(size) {
    this.size = size;
    this.tail = null;
    this.head = null;
  }

  setTail(val) {
    const newNode = new ListNode(val);
    if (!this.tail) {
      this.tail = newNode;
      this.head = newNode;
    } else {
      newNode.prev = this.tail;
      this.tail.next = newNode;
      this.tail = this.tail.next;
    }
  }

  setHead(val) {
    const newNode = new ListNode(val);

    if (!this.head) {
      this.head = newNode;
      this.tail = newNode;
    } else {
      newNode.next = this.head;
      this.head.prev = newNode;
      this.head = newNode;
    }
  }

  removeHead() {
    if (!this.head) return;

    const tmp = this.head.next;
    this.head.next = null;
    tmp && (tmp.prev = null);
    if (this.head === this.tail) this.tail = null;
    this.head = tmp;
  }

  removeTail() {
    if (!this.tail) return;

    const tmp = this.tail.prev;
    this.tail.prev = null;
    tmp && (tmp.next = null);
    if (this.tail === this.head) this.head = null;
    this.tail = tmp;
  }
}

return maxSlidingWindow;

