  const n = mat[0].length;

  const matrixName = "dp";

  const dp = Array.from(
    mat,
    (row, index) =>
      Array.from(row, (val) => val, null, {
        index,
        parentName: matrixName,
      }),
    null,
    { matrixName }
  );

