  const endQueue = new Queue();
  endQueue.enqueue({ word: endWord, level: 1 });

  const visitedBegin = new Map();
  const visitedEnd = new Map();
  visitedBegin.set(beginWord, 1);
  visitedEnd.set(endWord, 1);

