};

function visitWordNode(queue, visited, othersVisited, allComboDict) {
  const size = queue.size();

  for (let j = 0; j < size; j++) {
    const { word, level } = queue.dequeue();

    for (let i = 0; i < word.length; i++) {
      const newWord =
        word.substring(0, i) + "*" + word.substring(i + 1, word.length);

      const adjacentWords = allComboDict.get(newWord) || [];
      for (const adjacentWord of adjacentWords) {
        if (othersVisited.has(adjacentWord)) {
          return level + othersVisited.get(adjacentWord);
        }

        if (!visited.has(adjacentWord)) {
          visited.set(adjacentWord, level + 1);
          queue.enqueue({ word: adjacentWord, level: level + 1 });
        }
      }
    }
  }

  return -1;
}

