/**
 * @param {number[][]} grid
 * @return {Node}
 */
var construct = function (grid) {
  const n = grid.length;

  const dfs = (row, col, length) => {
    const newNode = new Node();

    if (length === 1) {
      grid[row].setColor(col, "green");
      newNode.val = grid[row][col];
      newNode.isLeaf = true;
    } else {
      const mid = length >> 1;

      grid[row].setColor(col, "cyan");
      grid[row].setColor(col + mid, "cyan");
      grid[row + mid].setColor(col, "cyan");
      grid[row + mid].setColor(col + mid, "cyan");

      newNode.topLeft = dfs(row, col, mid);
      newNode.topRight = dfs(row, col + mid, mid);
      newNode.bottomLeft = dfs(row + mid, col, mid);
      newNode.bottomRight = dfs(row + mid, col + mid, mid);

      newNode.val = newNode.topLeft.val;
      if (
        [
          newNode.topLeft,
          newNode.topRight,
          newNode.bottomLeft,
          newNode.bottomRight,
        ].every((node) => node.isLeaf && node.val === newNode.val)
      ) {
        newNode.isLeaf = true;
        newNode.topLeft =
          newNode.topRight =
          newNode.bottomLeft =
          newNode.bottomRight =
            null;
      }
    }

    return newNode;
  };

  return dfs(0, 0, n);
};

