var shortestPathLength = function (graph) {
  const n = graph.length;
  const all = (1 << n) - 1;
  const visited = new Set();
  const queue = new Queue();

  const getKey = (node, mask) => `${node}-${mask}`;

  class Node {
    constructor(node, mask, cost) {
      this.node = node;
      this.mask = mask;
      this.cost = cost;
    }
  }

  for (let i = 0; i < n; i++) {
    const maskValue = 1 << i;
    const currNode = new Node(i, maskValue, 1);
    queue.enqueue(currNode);
    visited.add(getKey(i, maskValue));
  }

  while (!queue.isEmpty()) {
    const curr = queue.dequeue();

    if (curr.mask === all) {
      return curr.cost - 1;
    }

    for (const neighbor of graph[curr.node]) {
      const bothVisitedMask = curr.mask | (1 << neighbor);
      const key = getKey(neighbor, bothVisitedMask);
      if (visited.has(key)) continue;
      visited.add(key);

      const newNode = new Node(neighbor, bothVisitedMask, curr.cost + 1);
      queue.enqueue(newNode);
    }
  }

  return -1;
};

return shortestPathLength;

