  if (nums1.length > nums2.length) {
    [nums1, nums2] = [nums2, nums1];
  }

  const m = nums1.length;
  const n = nums2.length;
  const total = m + n;
  const isEven = total % 2 === 0;

  let left = 0;
  let right = m;

  while (left <= right) {
    const partitionA = (left + right) >> 1;
    const partitionB = ((total + 1) >> 1) - partitionA;

    const maxLeftA = partitionA ? nums1[partitionA - 1] : -Infinity;
    const minRightA = partitionA < m ? nums1[partitionA] : Infinity;
    const maxLeftB = partitionB ? nums2[partitionB - 1] : -Infinity;
    const minRightB = partitionB < n ? nums2[partitionB] : Infinity;

    console.log({
      partitionA,
      partitionB,
      maxLeftA,
      minRightA,
      maxLeftB,
      minRightB,
    });

    if (maxLeftA <= minRightB && maxLeftB <= minRightA) {
      if (isEven) {
        return (
          (Math.max(maxLeftA, maxLeftB) + Math.min(minRightA, minRightB)) / 2
        );
      } else {
        return Math.max(maxLeftA, maxLeftB);
      }
    } else if (maxLeftA > minRightB) {
      right = partitionA - 1;
    } else {
      left = partitionA + 1;
    }
  }

  return 0;
};

