var minimumTime = function (n, relations, time) {
  const indegrees = new Uint32Array(n);
  const maxTimes = new Uint32Array(n);
  const adjList = {};

  for (let [from, to] of relations) {
    from--;
    to--;
    indegrees[to]++;
    (adjList[from] ??= []).push(to);
  }

  const queue = new Queue();
  for (let i = 0; i < n; i++) {
    if (indegrees[i] === 0) {
      queue.enqueue(i);
    }
  }
  if (queue.size() === 0) return -1;

  console.log(indegrees, adjList, queue.toArray());

  let result = 0;

  while (!queue.isEmpty()) {
    const size = queue.size();

    for (let i = 0; i < size; i++) {
      const node = queue.dequeue();
      maxTimes[node] += time[node];
      if (maxTimes[node] > result) {
        result = maxTimes[node];
      }

      if (!adjList[node]) continue;
      for (const neighbor of adjList[node]) {
        indegrees[neighbor]--;
        if (indegrees[neighbor] === 0) {
          queue.enqueue(neighbor);
        }
        maxTimes[neighbor] = Math.max(maxTimes[neighbor], maxTimes[node]);
      }
    }
  }

