    while (left >= 0 && right <= s.length) {
      if (s[left] !== s[right]) break;
      s.setColor(left, "green");
      s.setColor(left, null);
      if (right > left) {
        s.setColor(right, "green");
        s.setColor(right, null);
      }
      left--;
      right++;
    }

    return { maxLength: right - left + 1, left: left + 1, right: right - 1 };
  };

  let maxLength = 0;
  let bestMatch = null;

  for (let i = 0; i < s.length; i++) {
    const center = check(i, i);
    const doubles = check(i, i + 1);

    if (center.maxLength > maxLength) {
      maxLength = center.maxLength;
      bestMatch = center;
    }
    if (doubles.maxLength > maxLength) {
      maxLength = doubles.maxLength;
      bestMatch = doubles;
    }
  }

