var longestPalindrome = function (s) {
  // Step 1: Preprocess the input string
  const processedStr = Array.from(["^", "#"]);
  for (let i = 0; i < s.length; i++) {
    processedStr.push(s[i], "#");
  }
  processedStr.push("$");
  const modifiedString = processedStr.join("");

  // Step 2: Initialize variables for the algorithm
  const strLength = modifiedString.length;
  const palindromeLengths = new Array(strLength).fill(0);
  let center = 0; // Current center of the palindrome
  let rightEdge = 0; // Rightmost edge of the palindrome

  // Step 3: Loop through the modified string to find palindromes
  for (let i = 1; i < strLength - 1; i++) {
    if (rightEdge > i) {
      palindromeLengths[i] = Math.min(
        rightEdge - i,
        palindromeLengths[2 * center - i],
      );
    }

    // Expand the palindrome around the current character
    while (
      modifiedString[i + 1 + palindromeLengths[i]] ===
      modifiedString[i - 1 - palindromeLengths[i]]
    ) {
      palindromeLengths[i]++;
    }

    // Update the rightmost edge and center if necessary
    if (i + palindromeLengths[i] > rightEdge) {
      center = i;
      rightEdge = i + palindromeLengths[i];
    }
  }

  // Step 4: Find the longest palindrome and its center
  let maxLength = 0;
  let maxCenter = 0;
  for (let i = 0; i < strLength; i++) {
    if (palindromeLengths[i] > maxLength) {
      maxLength = palindromeLengths[i];
      maxCenter = i;
    }
  }

  // Step 5: Extract the longest palindrome from the modified string
  const start = (maxCenter - maxLength) / 2;
  const end = start + maxLength;

  // Return the longest palindrome in the original string
  return s.slice(start, end);
};

return longestPalindrome;

