 * @return {number[]}
 */
var findRedundantConnection = function (edges) {
  const par = Array.from({ length: edges.length + 1 }, (_, i) => i);
  const ranks = new Array(edges.length + 1).fill(1);

  const find = (node) => {
    let parent = par[node];

    while (parent !== par[parent]) {
      par[parent] = par[par[parent]];
      parent = par[parent];
    }

    return parent;
  };

  // returns false if already merged
  const union = (node1, node2) => {
    const parent1 = find(node1);
    const parent2 = find(node2);

    if (parent1 === parent2) return false;

    if (ranks[parent1] > ranks[parent2]) {
      par[parent2] = parent1;
      ranks[parent1] += ranks[parent2];
    } else {
      par[parent1] = parent2;
      ranks[parent2] += ranks[parent1];
    }

    return true;
  };

  for (const [from, to] of edges) {
    if (!union(from, to)) {
      return [from, to];
    }
  }
};

return findRedundantConnection;

