 * @return {boolean[]}
 */
var checkArithmeticSubarrays = function (nums, l, r) {
  const result = [];

  const isArithmetic = (left, right) => {
    if (right - left <= 1) return true;

    const arr = nums.slice(left, right + 1);
    const set = new Set();
    let min = Infinity;
    let max = -Infinity;
    for (const num of arr) {
      set.add(num);
      min = Math.min(min, num);
      max = Math.max(max, num);
    }

    const step = (max - min) / (arr.length - 1);
    if (!Number.isInteger(step)) return false;
    let curr = min + step;

    while (curr < max) {
      if (!set.has(curr)) return false;

      curr += step;
    }

    return true;
  };

  for (let i = 0; i < l.length; i++) {
    const left = l[i];
    const right = r[i];

    const value = isArithmetic(left, right);

    result.push(value);
  }

  return result;
};

return checkArithmeticSubarrays;

