  const extras = new Array();

  for (let row = 0; row < 3; row++) {
    for (let col = 0; col < 3; col++) {
      if (grid[row][col] === 0) {
        zeroes.push([row, col]);
      } else if (grid[row][col] > 1) {
        extras.push([row, col]);
      }
    }
  }

  const getDistance = (row1, col1, row2, col2) =>
    Math.abs(row1 - row2) + Math.abs(col1 - col2);

  const backtrack = (i) => {
    if (i === zeroes.length) {
      return 0;
    }
    zeroes.setColor(i, "green");

    let min = Infinity;
    const [zRow, zCol] = zeroes[i];
    for (let j = 0; j < extras.length; j++) {
      const [row, col] = extras[j];
      if (grid[row][col] <= 1) continue;
      extras.setColor(j, "cyan");
      grid[row][col]--;
      const next = backtrack(i + 1);
      grid[row][col]++;

      const distance = getDistance(zRow, zCol, row, col);
      min = Math.min(min, distance + next);
      extras.setColor(j, null);
    }

    console.log(i, min);
    zeroes.setColor(i, null);
    return min;
  };

  return backtrack(0);
};

