    let child = find(a);
    let target = find(b);
    if (child === target) return false;
    if (rank[child] > rank[target]) {
      [child, target] = [target, child];
    }

    par[child] = target;
    rank[target] += rank[child];
    rank[child] = 0;
    count--;

    return true;
  };

  for (let i = 0; i < edges.length; i++) {
    const [from, to] = edges[i];

    if (!union(from, to)) return false;
